  styleUrls: ['./education-list.component.css']
})
export class EducationListComponent {

  educationlist2: object[];

  constructor(){
    this.educationlist2 = [
      {titler: "adads", description: "dfgdfgdfgdfgdfg", period: ""},
      {titler: "qweqweqwe", description: "vbnvbnvbnvvbn", period: ""}
    ]
  }
}
